import React from "react";
import Home from "./routes/Home";
import Theme from "./Theme";
import { Component } from "react";
import { CssBaseline, GlobalStyles } from "@mui/material";
import { ThemeProvider, createTheme } from "@mui/material/styles";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

import "./video.css";
import MeteorMusic from "./Meteor-Music.png";

export class App extends Component {
  render() {
    return (
      <Router basename="/dryfettucine.github.io">
        <ThemeProvider theme={Theme}>
          <CssBaseline />
          <div style="padding:56.25% 0 0 0;position:relative;">
            <iframe
              src="https://player.vimeo.com/video/729476940?h=7fa4d9207d&amp;badge=0&amp;autopause=0&amp;player_id=0&amp;app_id=58479"
              frameborder="0"
              allow="autoplay; fullscreen; picture-in-picture"
              allowfullscreen
              style="position:absolute;top:0;left:0;width:100%;height:100%;"
              title="shootingstars.mp4"
            ></iframe>
          </div>
          <script src="https://player.vimeo.com/api/player.js"></script>
          <img src={MeteorMusic} className="titleimage"></img>

          <GlobalStyles
            styles={{
              body: { backgroundColor: "#121212" },
            }}
          />
          <Route exact path="/" component={Home} />
        </ThemeProvider>
      </Router>
    );
  }
}

export default App;
